import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Chatbot.css';
import chef from './images/p4.png'; 

const Chatbot = () => {
  const [input, setInput] = useState('');
  const [messages, setMessages] = useState([]);
  const [showDetails, setShowDetails] = useState({});

  const handleInputChange = (e) => {
    setInput(e.target.value);
  };

  const handleSend = () => {
    if (input.trim()) {
      const userMessage = { text: input, user: true };
      
      const botResponse = {
        text: `Here are some recipes you can make with ${input}:`,
        recipes: [
          { name: 'Recipe 1', details: 'Details of Recipe 1', image: 'path/to/image1.jpg' },
          { name: 'Recipe 2', details: 'Details of Recipe 2', image: 'path/to/image2.jpg' },
        ],
      };
      setMessages([...messages, userMessage, botResponse]);
      setInput('');
    }
  };

  const handleRecipeClick = (msgIndex, recipeIndex) => {
    const key = `${msgIndex}-${recipeIndex}`;
    setShowDetails((prev) => ({ ...prev, [key]: !prev[key] }));
  };

  const handleLoadMore = () => {
    const moreRecipes = [
      { name: 'Recipe 3', details: 'Details of Recipe 3', image: 'path/to/image3.jpg' },
      { name: 'Recipe 4', details: 'Details of Recipe 4', image: 'path/to/image4.jpg' },
      { name: 'Recipe 5', details: 'Details of Recipe 5', image: 'path/to/image5.jpg' },
      { name: 'Recipe 6', details: 'Details of Recipe 6', image: 'path/to/image6.jpg' },
      { name: 'Recipe 7', details: 'Details of Recipe 7', image: 'path/to/image7.jpg' },
    ];
    setMessages((prevMessages) => {
      const lastMessage = prevMessages[prevMessages.length - 1];
      if (lastMessage && lastMessage.recipes) {
        lastMessage.recipes = [...lastMessage.recipes, ...moreRecipes];
        return [...prevMessages];
      }
      return prevMessages;
    });
  };

  return (
    <div className="chatbot-container">
      <header className="chatbot-header">
        <h1 className="display-4">RECIPE REALM</h1>
      </header>
      <div className="chatbot-messages">
        {messages.map((msg, msgIndex) => (
          <div key={msgIndex} className={`message ${msg.user ? 'user' : 'bot'}`}>
            <div className="message-box-container">
              {!msg.user && (
                <div className="chef-image">
                  <img src={chef} alt="Chef" />
                </div>
              )}
              <div className={`message-box ${msg.user ? 'user-box' : 'bot-box'}`}>
                {msg.text}
                {msg.recipes && (
                  <div className="recipes">
                    {msg.recipes.map((recipe, recipeIndex) => (
                      <div key={recipeIndex} className="recipe">
                        <h5 onClick={() => handleRecipeClick(msgIndex, recipeIndex)}>{recipe.name}</h5>
                        {showDetails[`${msgIndex}-${recipeIndex}`] && (
                          <div className="recipe-details">
                            <p>{recipe.details}</p>
                            <img src={recipe.image} alt={recipe.name} />
                          </div>
                        )}
                      </div>
                    ))}
                  </div>
                )}
              </div>
            </div>
          </div>
        ))}
        {messages.length > 0 && messages[messages.length - 1].recipes && (
          <button className="btn btn-secondary" onClick={handleLoadMore}>Load More</button>
        )}
      </div>
      <div className="chatbot-input">
        <input
          type="text"
          className="form-control"
          placeholder="What do you have in your hands to cook...?"
          value={input}
          onChange={handleInputChange}
        />
        <button className="btn btn-primary" onClick={handleSend}>Send</button>
      </div>
    </div>
  );
};

export default Chatbot;
